import React,{useEffect,useState} from 'react'
import MenuBase from './MenuBase'
import { getallCategory } from './help/AddCategory'

export default function AdminShajiDashCategoryShow() {
    const [categories, setCategories] = useState([]);

    const fetchCategories = () => {
        getallCategory().then(data => {
            if (data.error) {
              console.log(data.error);
            } else {
              setCategories(data);
              console.log(data);
            }
          });
    }
    useEffect(() => {
        fetchCategories()
    }, [])
    return (
        <MenuBase>
                    <div className="container">
                   

                    <div className="card">
  <div className="card-body">   
    <h5 className="card-title">Card title</h5>
  
    <button className="btn btn-success rounded">Edit</button>
    <button className="btn btn-danger rounded ml-4">Delete</button>

  </div>
</div>



 
                    </div>
        </MenuBase>
    )
}
